Heres a focused review at 325px width. Im calling out concrete issues and CSS fixes.

---

## 1. **Layout overflow / clipping**
**Issue:** The table appears wider than the viewport; the rightmost column text (Category) is clipped (CAT), and body values are cut off. That indicates horizontal overflow in the table container.

**Fix (allow horizontal scroll at small widths):**
```css
/* wrapper around table */
.weapons-table-wrapper {
  overflow-x: auto;
  -webkit-overflow-scrolling: touch;
}

/* ensure table can be wider without forcing page overflow */
.weapons-table {
  min-width: 520px;
}
```

Alternative: hide less-important columns on small screens:
```css
@media (max-width: 360px) {
  .weapons-table th:nth-child(3),
  .weapons-table td:nth-child(3) {
    display: none; /* hide Category */
  }
}
```

---

## 2. **Touch targets**
**Issue:** The Back to Weapons link is thin and likely under 44px height. Also the tiny ? icon in the header is too small for touch.

**Fix:**
```css
.back-link {
  display: inline-flex;
  align-items: center;
  min-height: 44px;
  padding: 8px 12px;
}

.table-help-icon {
  width: 28px;
  height: 28px;
  display: inline-flex;
  align-items: center;
  justify-content: center;
}
```

---

## 3. **Text readability**
**Issue:** The list body text looks ~16px or smaller and low contrast for some grey text (e.g., category values). On small screens, the serif font + low contrast reduces readability.

**Fix (boost size + contrast for body cells):**
```css
.weapons-table td {
  font-size: 16px;
  color: #e6e1d8; /* brighter for readability */
}

.weapons-table td.category {
  color: #cfc7bc;
}
```

If youre keeping the theme, increase base size:
```css
@media (max-width: 360px) {
  body {
    font-size: 16px;
  }
}
```

---

## 4. **Table usability at narrow width**
**Issue:** Dense row height makes it hard to scan/tap. No row separation on small screen.

**Fix:**
```css
.weapons-table td,
.weapons-table th {
  padding: 12px 10px;
}

.weapons-table tr {
  border-bottom: 1px solid rgba(255,255,255,0.08);
}
```

---

## 5. **Visual bugs**
**Issue:** Header labels are truncated (CATE), and right column content is cut offthis is a real visual bug caused by insufficient width or overflow hidden on the table container.

**Fix (ensure container doesnt clip):**
```css
.table-container {
  overflow: visible; /* remove hidden overflow that clips */
}
```

If container must clip, use scroll as in section #1.

---

### Summary of key fixes to prioritize:
1. Add horizontal scroll or hide a column at <360px.
2. Increase tap target size for back link + header help icon.
3. Improve body text contrast and padding.

If you can share HTML class names, I can provide exact selector replacements.
